import './App.css';
import { BrowserRouter ,Route , Switch} from 'react-router-dom'
import LandingPage from './Components/LandingPage';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Route exact path='/' element={LandingPage}/>
      
    </div>
    </BrowserRouter>
  );
}

export default App;
